import React from "react";

import "./style.css";

export default function Artwave() {
    return (
        <div>
            <header>
                <h3>artwave</h3>
                <div className="linkIcons">
                    <i class="fab fa-github"></i>
                    <i class="fas fa-external-link-alt"></i>
                </div>
                <hr />
            </header>
        </div>
    )
}
